import React from 'react';
import { useEffect, useState } from 'react';
import { UserContext } from '../../context/UserContext';
import { IUser } from '../../interfaces/IUser';

interface UserContextProps {
	user: IUser;
}

const Details: React.FC = () => {
	const { user } = React.useContext(UserContext) as UserContextProps;

	return (
		<div className='w-100 h-100 bg-white flex flex-row'>
			<div className='info w-1/2 flex flex-col gap-3'>
				<p>Email:</p>
				<p className='h-1/2'>Address:</p>
				<p>Phone:</p>
				<p>Website:</p>
				<p>Company:</p>
			</div>
			<div className='more__info w-1/2 flex flex-col gap-3'>
				<p>{user.email}</p>
				<p>Street: {user.address.street}</p>
				<p>Suite: {user.address.suite}</p>
				<p>City: {user.address.city}</p>
				<p>Zipcode:: {user.address.zipcode}</p>
			</div>
		</div>
	);
};

export default Details;
